	public final static RequestHandler getInstance() {
		if (mInstance == null) {
			synchronized(RequestHandler.class) {
				if (mInstance == null) {
					mInstance = new RequestHandler();
				}
			}
		}
		return mInstance;
	}
	
	



	public RequestHandler(String url, Object params, Object callingObjet, String postExecutionMethodName, Activity activity, CACHE_KEY cache_key) {
		super();
		mRequestingUrl = url;
		mParams = params;
		mCallingObject= callingObjet;
		mCallingActivity = activity;
		if(postExecutionMethodName != null)
		{
			initPostExecutionMethod(postExecutionMethodName);
		}

		mCACHEKEY = cache_key;
	}

	public RequestHandler() {
	}



	private void initPostExecutionMethod(String methodName){

		try {
			mPostExecutionMethod = mCallingObject.getClass().getDeclaredMethod(methodName, Class.forName("java.lang.Object"));
		} catch(Exception e){
			e.printStackTrace();
		}

	}




	@Override
	protected  Object doInBackground(HttpRequestBase... params) {
		try{
			



			mDBAdapter =  new DBAdapter(this.mCallingActivity);
			
			mDBAdapter.deleteDatase();

			mDBAdapter.open();
			
			mDBAdapter.insertEntry(Constants.CACHE_KEY_LABELS.get(mCACHEKEY), "1", null, null, PLAYER_LIST);


			String aResponse = mDBAdapter.getSinlgeEntry(Constants.CACHE_KEY_LABELS.get(mCACHEKEY), "1");


			if (aResponse == null)
			{

				DefaultHttpClient client = new DefaultHttpClient();

				HttpResponse response = client.execute(params[0]);

				if (response == null) {
					return null;
				}

				final int code = response.getStatusLine().getStatusCode();

				if (code != 200) {
					return null;
				}

				// Read in the response

				BufferedInputStream aBufferedInputStream = new BufferedInputStream(response.getEntity().getContent());
				ByteArrayBuffer aByteArrayBuffer = new ByteArrayBuffer(50);// Read bytes to the Buffer until there is nothing more to read(-1)
				int current = 0;

				try {
					while((current = aBufferedInputStream.read()) != -1){
						aByteArrayBuffer.append((byte)current);
					}
					aResponse = new String(aByteArrayBuffer.toByteArray());
				} catch (IOException e) {
					e.printStackTrace();
				}

				aBufferedInputStream.close();	

				mResult = aResponse;

				if (aResponse != null)
				{

					mDBAdapter.insertEntry(Constants.CACHE_KEY_LABELS.get(mCACHEKEY), "1", null, null, aResponse);
				}
			}
			mDBAdapter.close();
			return aResponse;

		}catch (Exception e) {
			e.printStackTrace();
		}

		if (mDBAdapter != null && mDBAdapter.isOpen())
		{
			mDBAdapter.close();
		}
		return null;
	}


	@Override
	protected void onPostExecute(Object result) {
		super.onPostExecute(result);
		if(mCallingObject != null && mPostExecutionMethod != null) {
			try {
				mPostExecutionMethod.invoke(mCallingObject, result);
			} catch (IllegalArgumentException e) {
				e.printStackTrace();
			} catch (IllegalAccessException e) {
				e.printStackTrace();
			} catch (InvocationTargetException e) {
				e.printStackTrace();
			}
		}

		this.mPostExecutionMethod = null;
		this.mCallingObject = null;
		this.mCallingActivity = null;
		this.cancel(true);
	}


