	public void saveData(String dataToSave)
	{
		Pair<String, String> pair = new Pair<String, String>(Constants.CACHE_KEY_LABELS.get(mCACHEKEY), dataToSave);
		File file = new File(mCallingActivity.getCacheDir(), Constants.CACHE_FILE_NAME + Constants.CACHE_FILE_EXT);

		if (!file.exists())
		{

			try {
				file = File.createTempFile(Constants.CACHE_FILE_NAME, Constants.CACHE_FILE_EXT, mCallingActivity.getCacheDir());		
			}
			catch (IOException e) {/*Error while creating file*/}
		}

		try {
			FileWriter aFileWriter =  new FileWriter(file);
			aFileWriter.append(pair.first + ":" + pair.second);
			aFileWriter.append("\n");
			aFileWriter.close();

		}
		catch (IOException e) {
			// Error while creating file
		}

	}

